import { Link } from "react-router-dom";
import LogoRed from "../assets/logo_red.png";

function Header(){
    return(
        <div id="header_container">
            <div>
                <img src={LogoRed} alt="logo kasa" />
            </div>
            <nav>
                <Link to="/">Accueil</Link>
                <Link to="about">A Propos</Link>
            </nav>
        </div>
    )
}

export default Header;
